import React from 'react';
import List from '../component/List';

class ListCo extends React.Component{
	constructor(){
		super()
		this.state = {
			data: [
				{
					email: 'wahyudi14102001@gmail.com'
				},{
					email: 'front@outlook.com'
				},{
					email: 'programmer@outlook.com'
				}
			]
		}
	}

	render(){
		return (
			this.state.data.map((item, index) => {
			return <ListCo  key={index} nomor={index + 1}  email={item.email} />
		})
	  )
	}
}

export default ListCo;
